import React from "react";
import ReactDOM from "react-dom";
import "./styles/tailwind.css";
import App from "./App"; // Ton composant principal App

// React va "rendre" l'application App dans la div avec l'ID 'root' (qui est définie dans index.html)
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root") // Ceci est la "cible" de ton app (index.html)
);
